;; **
;;; ## The Captcha probabilistic program
;;; 
;;; Fill in the necessary blanks in the program in order to form a generative model.
;; **

;; @@
(anglican.infcomp.core/reset-infcomp-addressing-scheme!)
(def letter-dict "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ123456789") ; Dictionary mapping from letter-id to letter
(with-primitive-procedures [stochastic-renderer abc-dist]
  (defquery captcha [baseline-image]
    (let [;; Number of letters in CAPTCHA
          num-letters (sample (uniform-discrete 6 8))
          font-size (sample (uniform-discrete 38 44))
          kerning (sample (uniform-discrete -2 2))
          letter-ids (repeatedly num-letters #(sample "letterid" (uniform-discrete 0 (count letter-dict))))
          letters (apply str (map (partial nth letter-dict) letter-ids))

          ;; Render image using renderer from ...
          rendered-image (stochastic-renderer letters font-size kerning)]

      ;; ABC-style observe
      (observe (abc-dist rendered-image abc-sigma) baseline-image)

      ;; Returns
      {:letters letters
       :font-size font-size
       :kerning kerning})))
